import { GET_RELATIONS } from "../actions/types";

const initialState = {
    relations: [],

};

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_RELATIONS:
      return {
        ...state,
        relations:action.payload
    };
    default:
      return state;
  }
}
